 DROP TABLE inscrits;
 DROP TABLE eleves;
 DROP TABLE classes;
 DROP TABLE camps;
*/

--Création de la structure
CREATE TABLE camps (
 numero NUMBER(38) CONSTRAINT pk_camps PRIMARY KEY,
 lieu   VARCHAR2(20),
 prix   NUMBER(5,2),
 CONSTRAINT ch_camps_prix CHECK (prix > 0)
);

CREATE TABLE classes (
 numero NUMBER(38) CONSTRAINT pk_classes PRIMARY KEY,
 code   VARCHAR2(10) CONSTRAINT nn_classes_code NOT NULL,
 niveau NUMBER(1) CONSTRAINT nn_classes_niveau NOT NULL,
 obligation VARCHAR2(1) DEFAULT 'O' CONSTRAINT nn_classes_obligation NOT NULL,
 CONSTRAINT ch_classes_niveau CHECK (niveau BETWEEN 1 AND 4),
 CONSTRAINT ch_classes_obligation CHECK (obligation IN ('O','N')),
 CONSTRAINT uk_cla_code UNIQUE (code)
);

CREATE TABLE eleves (
 numero NUMBER(38) CONSTRAINT pk_eleves PRIMARY KEY,
 num_classe     NUMBER(38) CONSTRAINT nn_eleves_num_classe NOT NULL,
 matricule      VARCHAR2(10) CONSTRAINT nn_eleves_matricule NOT NULL,
 nom            VARCHAR2(50) CONSTRAINT nn_eleves_nom NOT NULL,
 prenom         VARCHAR2(50),
 date_naissance DATE,
 CONSTRAINT uk_ele_matricule UNIQUE (matricule),
 CONSTRAINT uk_ele_nom_prenom_date_naissan UNIQUE (nom, prenom, date_naissance),
 CONSTRAINT fk_eleves_classes FOREIGN KEY (num_classe) REFERENCES classes (numero)
);

CREATE TABLE inscrits (
 numero           NUMBER(38) CONSTRAINT pk_inscrits PRIMARY KEY,
 num_camp         NUMBER(38) CONSTRAINT nn_inscrits_num_camp NOT NULL,
 num_eleve        NUMBER(38) CONSTRAINT nn_inscrits_num_eleve NOT NULL,
 date_inscription DATE DEFAULT SYSDATE CONSTRAINT nn_inscrits_date_inscription NOT NULL,
 CONSTRAINT uk_ins_elenum_campnum UNIQUE (num_eleve, num_camp),
 CONSTRAINT fk_inscrits_camps FOREIGN KEY (num_camp) REFERENCES camps (numero),
 CONSTRAINT fk_inscrits_eleves FOREIGN KEY (num_eleve) REFERENCES eleves (numero)
);

CREATE SEQUENCE seq_camps START WITH 20;
CREATE SEQUENCE seq_eleves START WITH 3000;
CREATE SEQUENCE seq_classes START WITH 250;
CREATE SEQUENCE seq_inscrits START WITH 550;

